import React from 'react';
import axios from 'axios';

export default class SpaceXList extends React.Component{

  state = {
    SpaceX:[]
  }

  componentDidMount() {
    axios.get("https://api.spacexdata.com/v3/capsules")
    .then(res => {
      console.log(res);
      this.setState({ SpaceX : res.data });
    })
  }

  render() {
    return (
      <ul>
        {this.state.SpaceX.map(SpaceX => <li> { SpaceX } </li>)}
      </ul>
    )

  }

}
